             ['General',
              u'feber, svullnad p\xe5 injektionsst\xe4llet, rodnad Spontant rapporterade symtom som m\xf6jligen kan s\xe4ttas i samband med vaccination f\xf6rekom mindre vanligt och dessa bestod av frossa, andra reaktioner p\xe5 injektionsst\xe4llet och makulopapul\xf6sa utslag. Friska personer Reaktogenicitetsprofilen f\xf6r Fendrix bland friska personer var i stort j\xe4mf\xf6rbar med vad som s\xe5gs bland pre-hemodialys- och hemodialyspatienter. I en stor, dubbelblind, randomiserad j\xe4mf\xf6rande studie inkluderades friska personer f\xf6r att f\xe5 en 3-dos prim\xe4rvaccinering med Fendrix (N=713) eller med ett annat godk\xe4nt hepatit B-vaccin (N=238) vid 0, 1 och 2 m\xe5nader. De vanligaste biverkningarna som rapporterades var lokala reaktioner p\xe5 injektionsst\xe4llet. J\xe4mf\xf6rt med det andra vaccinet orsakade Fendrix mer \xf6verg\xe5ende lokala symtom, varav sm\xe4rta p\xe5 injektionsst\xe4llet \xe4r det efterfr\xe5gade lokala symtom som rapporterades mest frekvent. De allm\xe4nna symtom som efterfr\xe5gades visade dock liknande frekvenser i b\xe5da grupperna. Biverkningar rapporterade i en klinisk studie efter prim\xe4rvaccinering med Fendrix och som ansetts ha \xe5tminstone m\xf6jligt samband med vaccination har kategoriserats efter frekvens.'],
